    constructor(){
        super()
    }
render(){
    return(
        <div  className='socials_container'>
            <div id='facebook' className='social_container'>
            <img src="https://img.freepik.com/free-icon/facebook_318-566730.jpg?size=626&ext=jpg&ga=GA1.2.1249844358.1669888867&semt=sph"/>
            <div className='social_inner_container'>
                <h3>FOLLOW ME ON</h3>
                <p>SOCIAL FACEBOOK</p>
            </div>
            </div>
            <div id='instagram'  className='social_container'>
            <img src="https://cdn-icons-png.flaticon.com/512/733/733579.png?w=740&t=st=1683491505~exp=1683492105~hmac=102906b38a79bc716fa032e9b79692463c2e9c94b8bb3364386bd5209e01017f" />
            <div className='social_inner_container'>
                <h3>FOLLOW ME ON</h3>
                <p>SOCIAL INSTAGRAM</p>
            </div>
            </div>
            <div className='social_container'>
            <img src="https://cdn-icons-png.flaticon.com/512/733/733558.png?w=740&t=st=1683491534~exp=1683492134~hmac=41ac3e69cb442cdc69569a0b3fa7a044e00103dd597e5587495100f9919104fe" />
            <div className='social_inner_container'>
                <h3>FOLLOW ME ON</h3>
                <p>SOCIAL FACEBOOK</p>
            </div>
            </div>
        </div>
    )
}
}
export default Socials;
